On the other end of the LocalRepository is the RemoteRepository. This object represents the remote repository that the LocalRepository is connected to. It has the same url as the Remote object. pub struct RemoteRepository { pub namespace: String, pub name: String, pub remote: Remote,
} All repositories that are stored on the oxen-server have a namespace and name. This helps us organize the repositories on disk, as well as in a way that is meaningful to the user. In order to create a RemoteRepository we will first need to spin up an oxen-server instance. From your debug build you can do something like the following. export SYNC_DIR=/path/to/sync/dir
./target/debug/oxen-server start This will start a server on the default host 0.0.0.0 and port 3000. The environment variable SYNC_DIR tells the server where to write the data to on disk. Then we can use the oxen create-remote command from the CLI. oxen create-remote --name my-namespace/my-repo --host 0.0.0.0:3000 --scheme http If you look in the SYNC_DIR you will see a directory structure that mirrors the namespace/repo-name of the repository you just created. There will be a .oxen directory with the remote repository created for you as well. ls -trla /path/to/sync/dir/my-namespace/my-repo/.oxen What's cool is that on disk the RemoteRepository is the same structure as the LocalRepository. This means that we can use the same code to manipulate the RemoteRepository on the server as we can the LocalRepository on the client.
